![high](https://www.gstatic.com/codereviewagent/high-priority.svg)

There's a stale state issue here that will cause incorrect analytics data to be sent. 

The `useEffect` hook fetches user data and credits, then calls `setCredits` to update the state. However, the `sendUserAnalyticsData` function is called within the same effect's execution context, and it reads the `credits` state variable. Because `setState` is asynchronous and schedules a re-render, the `credits` variable used here is from the initial render (`undefined`), not the value that was just fetched. As a result, `creditsLeft` will always be reported as `0` to PostHog and Crisp on initial load.

To fix this, you should pass the fetched `credits` data directly to `sendUserAnalyticsData` instead of relying on the state variable within the same effect.

```typescript
    const getData = async () => {
      const { data } = await supabase.auth.getUser();
      const user = data?.user;
      if (!user) throw new Error('User not found');

      // Get user's credits
      const { data: creditsData } = await supabase
        .from('credits')
        .select('amount')
        .eq('user_id', user.id)
        .single();
      setCredits(creditsData);
      const { data: credit_transactions } = await supabase
        .from('credit_transactions')
        .select('*')
        .eq('user_id', user.id)
        .order('created_at', { ascending: false });
      setCreditTransactions(credit_transactions);
      return { user, credits: creditsData };
    };

    const sendUserAnalyticsData = (
      user: User,
      creditsData: Pick<Credit, 'amount'> | null | undefined,
    ) => {
      posthog.identify(user.id, {
        email: user.email,
        name: user.user_metadata.full_name || user.user_metadata.username,
        creditsLeft: creditsData?.amount || 0,
      });
      if (process.env.NEXT_PUBLIC_CRISP_WEBSITE_ID) {
        Crisp.configure(process.env.NEXT_PUBLIC_CRISP_WEBSITE_ID, {
          locale: lang,
        });
        user.email && Crisp.user.setEmail(user.email);
        const nickname =
          user.user_metadata.full_name || user.user_metadata.username;
        if (nickname) {
          Crisp.user.setNickname(nickname);
        }
        Crisp.session.setData({
          user_id: user.id,
          creditsLeft: creditsData?.amount || 0,
          // plan
        });
      }
    };

    getData()
      .then(({ user, credits }) => {
        sendUserAnalyticsData(user, credits);
      })
      .catch((error) => {
        console.error('Failed to initialize dashboard layout:', error);
      });
